const check = <i className="fa-solid fa-circle-check"></i>
const List = ({name , id , completed , removeTodo})=>{
   return(
    <>
       <li onDoubleClick={() => removeTodo(id) }>
            <p>{name}</p>
       </li>
       <div className="complete-btn">
        {check}
       </div>
    </>
   )
}


export default List;
